webpackJsonp([49508924878895],{557:function(a,e){a.exports={data:{file:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:.9657118055555556,src:"/static/avatar-820706df6fdb07a9b021a790449fec17-381d6.jpg",srcSet:"/static/avatar-820706df6fdb07a9b021a790449fec17-62f05.jpg 200w,\n/static/avatar-820706df6fdb07a9b021a790449fec17-dc2b4.jpg 400w,\n/static/avatar-820706df6fdb07a9b021a790449fec17-381d6.jpg 800w,\n/static/avatar-820706df6fdb07a9b021a790449fec17-e5d70.jpg 1200w,\n/static/avatar-820706df6fdb07a9b021a790449fec17-d14e0.jpg 1600w,\n/static/avatar-820706df6fdb07a9b021a790449fec17-9cc71.jpg 2225w",srcWebp:"/static/avatar-820706df6fdb07a9b021a790449fec17-fefde.webp",srcSetWebp:"/static/avatar-820706df6fdb07a9b021a790449fec17-5eed2.webp 200w,\n/static/avatar-820706df6fdb07a9b021a790449fec17-68e3c.webp 400w,\n/static/avatar-820706df6fdb07a9b021a790449fec17-fefde.webp 800w,\n/static/avatar-820706df6fdb07a9b021a790449fec17-300fe.webp 1200w,\n/static/avatar-820706df6fdb07a9b021a790449fec17-ed5bd.webp 1600w,\n/static/avatar-820706df6fdb07a9b021a790449fec17-9442a.webp 2225w",sizes:"(max-width: 800px) 100vw, 800px"}}},site:{siteMetadata:{title:"Kostas Bariotis' Blog",description:'Senior full stack engineer <a href="https://geekbot.io">@geekbot_io</a>, co-organizer of <a href="https://devitconf.org">@devitconf</a> & <a href="https://www.meetup.com/Thessaloniki-Node-js-Meetup/">@skgnodejs</a>, host of <a href="http://devastation.tv">Devastation Podcast</a>.',siteUrl:"https://kostasbariotis.com"}},mainPost:{html:'<p>Are you always in the wild trying to find the most awesome PHP projects? Are your bookmarks a mess?</p>\n<p>Here is a <a title="Awesome PHP" href="https://github.com/ziadoz/awesome-php" target="_blank">curated list</a> of amazingly awesome PHP libraries, resources and shiny things.</p>\n<p>Everything under a category, not every resource but the most promising that will definitely do your job.</p>\n<p>What are your thoughts?</p>',excerpt:"Are you always in the wild trying to find the most awesome PHP projects? Are your bookmarks a mess? Here is a  curated list  of amazingly…",frontmatter:{date:"August 22, 2014",path:"/a-collection-of-php-libraries-you-should-know/",tags:null,title:"A collection of PHP libraries you should know",draft:null}},nextPost:{html:'<p>A common dis-functionality of <a title="Composer PHP " href="https://getcomposer.org" target="_blank">Composer </a>is that when it just hangs while installing or updating dependencies. Especially when using heavy packages like these of Symfony, Composer is going to run hard.</p>\n<p>This issue is not new, and while there is been <a title="Composer freezing when installing symfony vendors" href="http://stackoverflow.com/questions/17138319/composer-freezing-when-installing-symfony-vendors" target="_blank">some </a><a title="Slow updating of composer dependencies, despite --prefer-dist flag" href="http://stackoverflow.com/questions/19316650/slow-updating-of-composer-dependencies-despite-prefer-dist-flag" target="_blank">discussion </a><a title="Running an update just hangs #1959" href="https://github.com/composer/composer/issues/1959" target="_blank">about </a><a title="Composer seems hanged on &quot;Updating dependencies&quot; #2378" href="https://github.com/composer/composer/issues/2378" target="_blank">it</a> i still encounter issues running on a generally old machine with 4GB ram and a Core2Duo CPU.</p>\n<p>Whilst i tried all of the suggested solution i ended up discovering that the problem is when you use the wildcard(*) for choosing the vendor package version.</p>\n<p>Prefer using the latest version of the package you want instead of the wildcard(*) the next time you encounter the same problem.</p>\n<p>Instead of writing</p>\n<div class="gatsby-highlight">\n      <pre class="language-json"><code class="language-json">&amp;quot<span class="token punctuation">;</span>require&amp;quot<span class="token punctuation">;</span><span class="token operator">:</span> <span class="token punctuation">{</span>\n\n    &amp;quot<span class="token punctuation">;</span>monolog/monolog&amp;quot<span class="token punctuation">;</span><span class="token operator">:</span>&amp;quot<span class="token punctuation">;</span><span class="token number">1.</span>*&amp;quot<span class="token punctuation">;</span>\n\n<span class="token punctuation">}</span>\n\n...\n</code></pre>\n      </div>\n<p>write</p>\n<div class="gatsby-highlight">\n      <pre class="language-json"><code class="language-json">...\n\n&amp;quot<span class="token punctuation">;</span>require&amp;quot<span class="token punctuation">;</span><span class="token operator">:</span> <span class="token punctuation">{</span>\n\n    &amp;quot<span class="token punctuation">;</span>monolog/monolog&amp;quot<span class="token punctuation">;</span><span class="token operator">:</span>&amp;quot<span class="token punctuation">;</span><span class="token number">1.10</span><span class="token number">.0</span>&amp;quot<span class="token punctuation">;</span>\n\n<span class="token punctuation">}</span>\n\n...\n</code></pre>\n      </div>\n<p> </p>\n<p>You can also try cleaning your Composer cache which is located at %APPDATA%/local/composer/ on Windows and using -<a title="Composer Install Dependencies CLI options" href="https://getcomposer.org/doc/03-cli.md#install" target="_blank">-prefer-dist</a> flag which tries to download a zip file of the package whenever one is available.</p>\n<p>Last but not least, use --vvv flag for a more <a title="Composer CLI Global Options" href="https://getcomposer.org/doc/03-cli.md#global-options" target="_blank">verbose </a>output of the Composer and --profile displaying some hardware information at the end.</p>',excerpt:"A common dis-functionality of  Composer  is that when it just hangs while installing or updating dependencies. Especially when using heavy…",frontmatter:{date:"August 09, 2014",path:"/composer-hangs-while-installingupdating-dependencies/",tags:null,title:"Composer hangs while installing/updating dependencies",draft:null}}},pathContext:{mainPostPath:"/a-collection-of-php-libraries-you-should-know/",nextPostPath:"/composer-hangs-while-installingupdating-dependencies/"}}}});
